import React, { Component } from "react";
// import NotePage from "../components/NotePage";
import MyTabPanel from "../components/MyTabPanel";
import NewNoteForm from "../components/NewNoteForm";
import { Button } from "reactstrap";

class App extends Component {
  constructor() {
    super();
    this.state = {
      showComponent: false,
      buttonlabel: "New Note"
    };
    this.onClickNewNote = this.onClickNewNote.bind(this);
    this.changeButtonLabel = this.changeButtonLabel.bind(this);
  }

  onClickNewNote() {
    this.setState({
      showComponent: true,
    });
  }

  changeButtonLabel(buttonlabel) {
    this.setState ({
      buttonlabel: buttonlabel
    });
  }

  render() {
    return (
      <div className="container">
        <MyTabPanel />
        <div>
          {/* <Button onClick={() => this.onClickNewNote()}> New Note </Button> */}
          {/* {this.state.showComponent ? */}
           <NewNoteForm/>
           {/* null
        } */}
        </div>
      </div>
    );
  }
}

export default App;
